INSERT INTO `privacy_policies` (`id`, `heading`, `content`, `status`, `created_at`) VALUES
(1, 'hello', '<p>fjh</p><p>f</p><p>j</p><p>s</p><p>fs</p><p>dfsdfsfsdfsf</p>', 0, '2017-07-24 10:05:50'),
(2, 'Mobicharge Advantages', '<h5 style="margin-top: 0px; padding: 0px; font-size: 14px; color: rgb(132, 132, 132); font-family: Arial, sans-serif; letter-spacing: -0.2px;">Online shopping in India at its best</h5><p><span style="color: rgb(132, 132, 132); font-family: Arial, sans-serif; font-size: 11px; letter-spacing: -0.2px;">It\'s no longer just the privilege of a metro city or an urban area to shop online for their favorite products. Mobicharge is one online shopping site that has made it possible for consumers even in the remote areas of India to avail products from the best brands at low prices online. Considering the present lifestyle of people, it\'s no surprise that they prefer to buy online most of the products that they need on a daily basis like&nbsp;</span><span style="font-family: Arial, sans-serif; font-size: 11px; letter-spacing: -0.2px;">clothes for man</span><span style="color: rgb(132, 132, 132); font-family: Arial, sans-serif; font-size: 11px; letter-spacing: -0.2px;">&nbsp;and women, electronics, mobiles, home appliances, products for&nbsp;</span><span style="font-family: Arial, sans-serif; font-size: 11px; letter-spacing: -0.2px;">personal beauty and care</span><span style="color: rgb(132, 132, 132); font-family: Arial, sans-serif; font-size: 11px; letter-spacing: -0.2px;">&nbsp;and the like. The ultimate convenience of having to simply browse through their favorite online shopping website and place orders from the comfort of their home, and get it delivered in the shortest time possible at their doorstep is a service that is unbeatable.</span><br style="margin: 0px; padding: 0px; color: rgb(132, 132, 132); font-family: Arial, sans-serif; font-size: 11px; letter-spacing: -0.2px;"><br style="margin: 0px; padding: 0px; color: rgb(132, 132, 132); font-family: Arial, sans-serif; font-size: 11px; letter-spacing: -0.2px;"></p><h5 style="margin-top: 0px; margin-right: 0px; margin-left: 0px; padding: 0px; font-size: 14px; color: rgb(132, 132, 132); font-family: Arial, sans-serif; letter-spacing: -0.2px;">Easy return policies and quick delivery</h5><p><br style="margin: 0px; padding: 0px; color: rgb(132, 132, 132); font-family: Arial, sans-serif; font-size: 11px; letter-spacing: -0.2px;"><span style="color: rgb(132, 132, 132); font-family: Arial, sans-serif; font-size: 11px; letter-spacing: -0.2px;">These are some of the perks of shopping online at Mobicharge. Return policies vary from product to product. We are very particular that not even a small mistake from our side should ruin your shopping experience. Hence, we give you the convenience to return your product anytime within a certain number of days of your purchase.&nbsp;</span><br style="margin: 0px; padding: 0px; color: rgb(132, 132, 132); font-family: Arial, sans-serif; font-size: 11px; letter-spacing: -0.2px;"><br style="margin: 0px; padding: 0px; color: rgb(132, 132, 132); font-family: Arial, sans-serif; font-size: 11px; letter-spacing: -0.2px;"><span style="color: rgb(132, 132, 132); font-family: Arial, sans-serif; font-size: 11px; letter-spacing: -0.2px;">When you order something online, you would love to get it delivered as soon as possible, and Mobicharge stands just for that. Buy your favorite brands at the best prices in India, and get them delivered at your doorstep as quick as possible. Along with using the best logistics service to deliver your order, you can easily track your shipment using your email ID and tracking ID.</span><br style="margin: 0px; padding: 0px; color: rgb(132, 132, 132); font-family: Arial, sans-serif; font-size: 11px; letter-spacing: -0.2px;"></p><p></p><p></p>', 1, '2017-07-24 10:12:04');
INSERT INTO `products` (`id`, `user_id`, `title`, `price`, `compare_price`, `quantity`, `thumbnail`, `option_name`, `option_values`, `sku`, `category_id`, `description`, `shipping`, `status`, `hot_sale`, `thumbnail2`, `thumbnail3`, `thumbnail4`, `subtitle`, `brand`, `color_code`, `color`, `tags`, `features`, `model_name`, `model_number`, `created_at`, `designed_for`, `sales_package`, `suitable_for`, `type`, `capacity`, `capacity_unit`, `width`, `height`, `length`, `length_unit`, `width_unit`, `height_unit`, `thickness`, `thickness_unit`, `warrenty`, `warrenty_summary`, `warrenty_service_type`, `covered_in_warrenty`, `no_in_warrenty`, `is_fragile`, `video_url`, `weight_unit`, `weight`, `upload_type`, `connector_type`, `material`, `other_feature`, `key_feature`, `is_approved`) VALUES
(8879, 1, ' ', '400', 300, 10, 'https://www.dropbox.com/s/eyf02d6zydqhvgu/BLACK%20GORILLA.jpg?raw=1', NULL, NULL, 'TAB-SPRE-A-APPLEIPAD2', 136, 'The screen protector fits perfectly over the phone to prevent scratches and absorb shocks. Since the edges of the phone screen are the most likely parts to crack, screen protector follows the natural curvature of the Phone to prevent chipping. This screen protector is adhered to phones with a silicon adhesive to keep it in place. The transparent screen protector fits perfectly over top of the Phone touch screen, leaving no gaps in between so that sensitivity is not affected. Additionally, the screen protector is covered in an oleophobic coating to prevent fingerprints and other smudges. Tempered glass construction for enhanced impact resistance and reduce the chances of screen damage. Made with chemically treated, transparent tempered glass with silicon adhesive to keep it in place. The surface has a hardness of 8-9H,which is 3 times stronger than regular PET film. Sharp objects such as knives and keys will not scratch the surface. The screen protector has an "Oleophobic" coating, which prevents fingerprints and other contaminants which makes the screen protector easy to clean. In case of screen damage, the screen protector will break into small pieces that are not sharp, making it a lot safer than other glass screen protector available in the market.', NULL, 1, 0, 'https://www.dropbox.com/s/4q27x58g63r83ix/TEMPERED%20GLASS%20IMAGE%201.jpg?raw=1', 'https://www.dropbox.com/s/voz1rfxks5v6l2s/Tempered%20Glass%20Image%202.jpg?raw=1', 'https://www.dropbox.com/s/yf7uenozq193v73/Tempered%20Glass%20Image%204.jpg?raw=1', 'Tablet', 'BLACK GORILLA', NULL, 'Transparent', 'TEMPERED GLASS, SCREEN PROTECTOR, TEMPERED, SCREEN GUARD,  GLASS, MOBILE GLASS, STRONG GLASS, TOUGH GLASS, BLACK GORILLA, ACE GORILLA, ARCHAIC GORILLA, TELESHIELD, CELLSHIELD, NINE H, 9H, RIGID, RESOLUTE, OBSTINATE, ZINGER, AUROCHS, BLACK ARROW, CRUNK, BLATE, GORILLA 