(9088, 1, NULL, '400', 300, 10, 'https://www.dropbox.com/s/qrao2nuq723j150/CELLSHIELD.png?raw=1', NULL, NULL, 'TAB-SPRE-E-SAMSUNGGALAXYNOTE8', 136, 'The screen protector fits perfectly over the phone to prevent scratches and absorb shocks. Since the edges of the phone screen are the most likely parts to crack, screen protector follows the natural curvature of the Phone to prevent chipping. This screen protector is adhered to phones with a silicon adhesive to keep it in place. The transparent screen protector fits perfectly over top of the Phone touch screen, leaving no gaps in between so that sensitivity is not affected. Additionally, the screen protector is covered in an oleophobic coating to prevent fingerprints and other smudges. Tempered glass construction for enhanced impact resistance and reduce the chances of screen damage. Made with chemically treated, transparent tempered glass with silicon adhesive to keep it in place. The surface has a hardness of 8-9H,which is 3 times stronger than regular PET film. Sharp objects such as knives and keys will not scratch the surface. The screen protector has an "Oleophobic" coating, which prevents fingerprints and other contaminants which makes the screen protector easy to clean. In case of screen damage, the screen protector will break into small pieces that are not sharp, making it a lot safer than other glass screen protector available in the market.', NULL, 1, 0, 'https://www.dropbox.com/s/4q27x58g63r83ix/TEMPERED%20GLASS%20IMAGE%201.jpg?raw=1', 'https://www.dropbox.com/s/voz1rfxks5v6l2s/Tempered%20Glass%20Image%202.jpg?raw=1', 'https://www.dropbox.com/s/yf7uenozq193v73/Tempered%20Glass%20Image%204.jpg?raw=1', 'Mobile', 'CELLSHIELD', NULL, 'Transparent', 'TEMPERED GLASS, SCREEN PROTECTOR, TEMPERED, SCREEN GUARD,  GLASS, MOBILE GLASS, STRONG GLASS, TOUGH GLASS, BLACK GORILLA, ACE GORILLA, ARCHAIC GORILLA, TELESHIELD, CELLSHIELD, NINE H, 9H, RIGID, RESOLUTE, OBSTINATE, ZINGER, AUROCHS, BLACK ARROW, CRUNK, BLATE, GORILLA